import { MockDataPieChart } from "./components/MockDataPieChart";



export const DashboardPage = () => {



    return (
    <> 
      <div className="m-20 dashboard-bg-color">
        <div className="d-flex justify-content-space-between align-items-center">
          <h1>Dashboard</h1>
        </div>
        <div className="d-flex justify-content-space-between align-items-center">
          <h2>Welcome to your dashboard</h2>
        </div>

      <BarChart data={getExpenseBarChartDataByType()} /> 
      </div>

      <div>
        <PieChart data={MockDataPieChart} />
      </div>




    </>
  );
};
